[FirstTimeAuditions./ RealityKings.] Shane Dos Santos (Sweet Release)



Shane stopped by to audition and immediately requested to use the bathroom. When she neglected to close the door to the bathroom, I decided to start rolling and see what she was doing in there. Sadly, she was only brushing her teeth and putting on lip gloss. She wanted to make sure she looked her best on her first time. Once we made it to the casting couch I fixated on her eyes and how amazingly gorgeous they were. This girl is extremely beautiful and also totally willing to have a blast.



